const GameList = ({ games, fetchGames, setSelectedGame }) => {
  const [editMessage, setEditMessage] = useState('');
  const [deleteId, setDeleteId] = useState(null);
  const [openConfirm, setOpenConfirm] = useState(false);

  const handleDeleteClick = (id) => {
    setDeleteId(id);
    setOpenConfirm(true);
  };

  const confirmDelete = async () => {
    try {
      await axios.delete(`/games/${deleteId}`);
      fetchGames();
    } catch (error) {
      console.error("Error deleting the game:", error);
    } finally {
      setOpenConfirm(false);
      setDeleteId(null);
    }
  };

  const handleEditClick = (game) => {
    setSelectedGame(game);
    setEditMessage('Edit in Update section');
    setTimeout(() => setEditMessage(''), 3000);
  };

  return (
    <>
      {/* Snackbar for Edit Message */}
      <Snackbar
        open={editMessage !== ''}
        onClose={() => setEditMessage('')}
        autoHideDuration={3000}
        anchorOrigin={{ vertical: 'top', horizontal: 'center' }}
        message={
          <Box display="flex" alignItems="center">
            <ErrorOutline sx={{ marginRight: 1, fontSize: 20 }} />
            {editMessage}
          </Box>
        }
      />

      {/* Confirm Delete Dialog */}
      <Dialog open={openConfirm} onClose={() => setOpenConfirm(false)}>
        <DialogTitle>Confirm Deletion</DialogTitle>
        <DialogContent>
          Are you sure you want to delete this game?
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setOpenConfirm(false)} color="primary">
            Cancel
          </Button>
          <Button onClick={confirmDelete} color="error" autoFocus>
            Delete
          </Button>
        </DialogActions>
      </Dialog>

      {/* Game List */}
      <Card sx={{ maxWidth: 600, margin: 'auto', padding: 3, borderRadius: 2, boxShadow: 3 }}>
        <CardContent>
          <Typography variant="h6" gutterBottom sx={{ textAlign: 'center', fontSize: '18px' }}>
            All Games
          </Typography>

          <List>
            {games.map((game) => (
              <ListItem key={game._id} divider sx={{ display: 'flex', alignItems: 'center', borderRadius: '10px', px: 2, py: 1 }}>
                <ListItemText
                  primary={<strong>{game.name}</strong>}
                  secondary={`By ${game.author} | Game ID: ${game._id}`}
                  sx={{ fontSize: '16px' }}
                />
                <ListItemSecondaryAction>
                  <Box display="flex" alignItems="center">
                    <IconButton
                      edge="end"
                      href={game.url}
                      target="_blank"
                      rel="noreferrer"
                      sx={{
                        color: '#4CAF50',
                        backgroundColor: '#e8f5e9',
                        borderRadius: '5px',
                        marginRight: 1,
                        padding: '6px',
                        '&:hover': {
                          backgroundColor: '#c8e6c9',
                        },
                      }}
                    >
                      <LanguageIcon fontSize="small" />
                    </IconButton>

                    <IconButton
                      edge="end"
                      onClick={() => handleEditClick(game)}
                      sx={{
                        color: '#4CAF50',
                        backgroundColor: '#e8f5e9',
                        borderRadius: '5px',
                        marginRight: 1,
                        padding: '6px',
                        '&:hover': {
                          backgroundColor: '#c8e6c9',
                        },
                      }}
                    >
                      <Edit fontSize="small" />
                    </IconButton>

                    <IconButton
                      edge="end"
                      onClick={() => handleDeleteClick(game._id)}
                      sx={{
                        color: '#f44336',
                        backgroundColor: '#ffebee',
                        borderRadius: '5px',
                        padding: '6px',
                        '&:hover': {
                          backgroundColor: '#ffcdd2',
                        },
                      }}
                    >
                      <Delete fontSize="small" />
                    </IconButton>
                  </Box>
                </ListItemSecondaryAction>
              </ListItem>
            ))}
          </List>
        </CardContent>
      </Card>
    </>
  );
};
